constant "Vote" { EcFixedPoint VALUE_COMMIT_VALUE, EcFixedPoint VALUE_COMMIT_RANDOM, EcFixedPoint NULLIFIER_K,
} contract "Vote" { Base process_id_0, Base process_id_1, Base secret_key, Base vote, Scalar vote_blind, Uint32 leaf_pos, MerklePath path,
} circuit "Vote" { # Nullifier hash process_id = poseidon_hash(process_id_0, process_id_1); nullifier = poseidon_hash(secret_key, process_id); constrain_instance(nullifier); # Public key derivation and hashing public_key = ec_mul_base(secret_key, NULLIFIER_K); public_x = ec_get_x(public_key); public_y = ec_get_y(public_key); pk_hash = poseidon_hash(public_x, public_y); # Merkle root root = calculate_merkle_root(leaf_pos, path, pk_hash); constrain_instance(root); # Pedersen commitment for vote vcv = ec_mul_short(vote, VALUE_COMMIT_VALUE); vcr = ec_mul(vote_blind, VALUE_COMMIT_RANDOM); vote_commit = ec_add(vcv, vcr); # Since vote_commit is a curve point, we fetch its coordinates # and constrain_them: vote_commit_x = ec_get_x(vote_commit); vote_commit_y = ec_get_y(vote_commit); constrain_instance(vote_commit_x); constrain_instance(vote_commit_y);
} Our proof consists of four main operation. First we are hashing the nullifier using our secret key and the hashed process ID. Next, we derive our public key and hash it. Following, we take this hash and create a Merkle proof that it is indeed contained in the given Merkle tree. And finally, we create a Pedersen commitment [3] for the vote choice itself. Our vector of public inputs can look like this: let public_inputs = vec![ nullifier, merkle_root, *vote_coords.x(), *vote_coords.y(),
] And then the Verifier uses these public inputs to verify the given zero-knowledge proof. Specification taken from vocdoni franchise proof Merkle tree on Wikipedia See section 3: The Commitment Scheme of Torben Pryds Pedersen's paper on Non-Interactive and Information-Theoretic Secure Verifiable Secret Sharing
